    <KategoriSayfasi
      kategoriAdi="Orta Okul Kitapları"
      aciklama="Ortaokul öğrencileri için ders kitapları, test kitapları ve yardımcı kaynaklar."
    />
  );
};

export default OrtaOkulKitaplari;
